import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card
      name={contacts.name[0]}
      img={contacts.imgURL[0]}
      tell={contacts.phone[0]}
      email={contacts.email[0]}
       />
    </div>
  );
}

export default App;
